# Appendix B: Derivation of the equations for RCLS 

The RCLS problem in Eq. 15 constitutes a linear leastsquares minimization subject to linear equality constraints and a regularization term. The first step in solving the problem is to represent the solution space for $\mathbf{x}$ in a basis in which its components are either fully determined by the constraints (i.e. in the image of the constraint matrix) or completely unconstrained (i.e. in the null space of the constraint matrix). As described, for example, in Ref. [50] (Section 3.4) or [51], this can be done by computing the "full" QR factorization of the transpose of the constraint matrix $\mathbf{C}^{T}$ :

$$
\mathbf{C}^{T}=\left[\begin{array}{ll}
\mathbf{Q} & \tilde{\mathbf{Q}}
\end{array}\right]\left[\begin{array}{l}
\mathbf{R} \\
0
\end{array}\right]
$$

Here, $\mathbf{C} \in \mathbb{R}^{p \times n}$ is the constraint matrix as defined in Eq. 8, $n$ is the number of elements in $\mathbf{x}$ (the number of wireframe segments), and $p$ is the number of linearly independent constraint equations. The $p$ columns of submatrix $\mathbf{Q} \in \mathbb{R}^{n \times p}$ and the $n-p$ columns of $\tilde{\mathbf{Q}} \in \mathbb{R}^{n \times\{n-p\}}$ are orthonormal unit vectors, and $\mathbf{R} \in \mathbb{R}^{(n-p) \times\{n-p\}}$ is an upper triangular matrix.

Now define vectors $\mathbf{u} \in \mathbb{R}^{p}$ and $\mathbf{v} \in \mathbb{R}^{n-p}$ in the bases specified by the columns of $\mathbf{Q}$ and $\tilde{\mathbf{Q}}$ :

$$
\left[\begin{array}{l}
\mathbf{Q}^{T} \\
\tilde{\mathbf{Q}}^{T}
\end{array}\right] \mathbf{x}=\left[\begin{array}{l}
\mathbf{u} \\
\mathbf{v}
\end{array}\right]
$$

Using the orthogonality property of the matrix on the left-hand side of Eq. B2, $\mathbf{x}$ may be written in terms of $\mathbf{u}$ and $\mathbf{v}$ as

$$
\mathbf{x}=\left[\begin{array}{ll}
\mathbf{Q} & \tilde{\mathbf{Q}}
\end{array}\right]\left[\begin{array}{l}
\mathbf{u} \\
\mathbf{v}
\end{array}\right]=\mathbf{Q u}+\tilde{\mathbf{Q}} \mathbf{v}
$$

Using Eq. B3, Eq. 16 can be expressed as

$$
\mathbf{R}^{T} \mathbf{Q}^{T} \mathbf{x}=\mathbf{d}
$$

or, after incorporating Eq. B2,

$$
\mathbf{R}^{T} \mathbf{u}=\mathbf{d}
$$

Thus, the constraints fix the vector $\mathbf{u}$ whereas $\mathbf{v}$ represents the part of the solution that is unrestricted by the constraints. Eq. B5 can be solved efficiently for $\mathbf{u}$ using forward substitution, as $\mathbf{R}^{T}$ is lower triangular.

With $\mathbf{u}$ now known, it remains to determine $\mathbf{v}$, the unconstrained part of the solution. Using Eq. B3, the total objective function $f$ may be written as

$$
f=\frac{1}{2}(\mathbf{A Q u}+\mathbf{A} \tilde{\mathbf{Q}} \mathbf{v}-\mathbf{b})^{2}+\frac{1}{2}(\mathbf{W Q u}+\mathbf{W} \tilde{\mathbf{Q}} \mathbf{v})^{2}
$$

The least-squares solution $\mathbf{v}^{*}$ that minimizes $f$ is that which causes the gradient of $f$ to vanish:
$\nabla_{\mathbf{v}} f=\tilde{\mathbf{Q}}^{T} \mathbf{A}^{T}(\mathbf{A Q u}+\mathbf{A} \tilde{\mathbf{Q}} \mathbf{v}-\mathbf{b})+\tilde{\mathbf{Q}}^{T} \mathbf{W}^{T}(\mathbf{W} \mathbf{Q} \mathbf{u}+\mathbf{W} \tilde{\mathbf{Q}} \mathbf{v})=0$
Collecting like terms and rearranging leads to
$\tilde{\mathbf{Q}}^{T}\left(\mathbf{A}^{T} \mathbf{A} \tilde{\mathbf{Q}}+\mathbf{W}^{T} \mathbf{W} \tilde{\mathbf{Q}}\right) \mathbf{v}=\tilde{\mathbf{Q}}^{T}\left(\mathbf{A}^{T} \mathbf{b}-\mathbf{A}^{T} \mathbf{A} \mathbf{Q}-\mathbf{W}^{T} \mathbf{W} \mathbf{Q}\right) \mathbf{u}$
Eq. B8 constitutes a system of linear equations that can then be solved directly for $\mathbf{v}$. Along with the solution for $\mathbf{u}$ determined in Eq. B5, the solution $\mathbf{x}^{*}$ to the constrained least squares problem can then be computed via Eq. B3.

For high-resolution wireframes, in which the matrices $\mathbf{A}$ and $\mathbf{W}$ are large, the problem may be difficult to solve directly due to memory constraints and poor matrix conditioning. In this case, iterative algorithms with preconditioners may be employed. Similar high-dimensional constrained linear least squares problems have been solved with such techniques, for example, in Ref. [26].
